import React from "react";
import { projects } from "../projects.json";
import { Link } from "react-router-dom";

import {
  Card,
  Box,
  Button,
  Divider,
  Image,
  Stack,
  Set,
  Heading,
  Container,
  Columns,
  Text,
  Paragraph,
  Badge,
} from "bumbag";

const Project = ({ title, info, link }) => (
    <Box paddingY='major-4'>
      <Columns>
      <Columns.Column spread={4} alignSelf='center'>
        <a href={link} target>
      <Heading
        use="h4"
        fontWeight="semibold"
        paddingTop="1.5rem"
        paddingBottom="1.5rem"
        cursor='pointer'
        _hover={{ color: 'terciary' }}
      >
        {title}
      </Heading>
      </a>
      </Columns.Column>
      <Columns.Column spread={4}>
      <Paragraph
        paddingTop="1.5rem"
        paddingBottom="1.5rem"
        color="secondary"
        lineHeight={{ default: "1.8rem", "max-tablet": "1.2rem" }}
      >
        {info}
      </Paragraph>
      </Columns.Column>
      </Columns>
      <Divider color='secondary' opacity='0.7' />
    </Box>
);

const Projects = () => {
  return (
    <Box>
      <Heading use="h4" marginBottom="major-4">
        Projects
      </Heading>
      {projects.map((project) => (
        <Project {...project} />
      ))}
    </Box>
  );
};

export default Projects;
